# 1
# @param {Integer[]} nums
# @return {Integer}
def smallest_equal(nums)
    nums.each_index{
        |i|
        if i % 10 == nums[i]
            return i
        end
    }
    return -1
end

# 2
# Definition for singly-linked list.
# class ListNode
#     attr_accessor :val, :next
#     def initialize(val = 0, _next = nil)
#         @val = val
#         @next = _next
#     end
# end
# @param {ListNode} head
# @return {Integer[]}
def nodes_between_critical_points(head)
    result = [-1, -1]
    if head == nil || head.next == nil || head.next.next == nil
        return result
    end
    cur = head.next
    firstIdx = -1
    preIdx = -1
    pre = head
    i = 1
    while cur.next != nil
        if (cur.val > pre.val && cur.val > cur.next.val) || (cur.val < pre.val && cur.val < cur.next.val)
            if firstIdx != -1
                result[1] = i - firstIdx
            end
            if preIdx != -1
                if result[0] == -1 || result[0] > i - preIdx
                    result[0] = i - preIdx
                end
            end
            if firstIdx == -1
                firstIdx = i
            end
            preIdx = i
        end
        pre = cur
        cur = cur.next
        i += 1
    end
    return result
end

# 3
# @param {Integer[]} nums
# @param {Integer} start
# @param {Integer} goal
# @return {Integer}
def minimum_operations(nums, start, goal)
    set = Hash.new
    nums.each{
        |v|
        set[v] = true
    }
    q = [goal]
    round = 0
    mask = Array.new(1001){0}
    while !q.empty?
        nq = []
        q.each{
            |v|
            if v == start
                return round
            end
            nums.each{
                |delta|
                [v + delta, v - delta, v ^ delta].each{
                    |nv|
                    if nv >= 0 && nv <= 1000 && mask[nv] == 0
                        mask[nv] = 1
                        nq.append nv
                    end
                }
            }
        }
        round += 1
        q = nq
    end
    return -1
end

# 4
# @param {String} s1
# @param {String} s2
# @return {Boolean}
def possibly_equals(s1, s2)
    l1, l2 = s1.length, s2.length
    # dp[si][sj][ei][ej] 是否匹配
    dp = Array.new(l1){Array.new(l2){Array.new(l1){Array.new(l2){false}}}}
    i = 0
    while i < l1
        j = 0
        while j < l2
            if s1[i] == s2[j] || (s1[i] == '1' && s2[j] >= 'a' && s2[j] <= 'z') || (s2[j] == '1' && s1[i] >= 'a' && s1[i] <= 'z')
                dp[i][j][i][j] = true
            end
            j += 1
        end
        i += 1
    end

    cnt1 = 1
    while cnt1 < l1
        cnt2 = 1
        while cnt2 < l2
            i = 0
            while i < l1
                j = 0
                while j < l2
                    done = false
                    si, sj, ei, ej = i, j, i + cnt1, j + cnt2
                    pre1 = si
                    while pre1 < ei && !done
                        pre2 = sj
                        while pre2 < ej && !done
                            if dp[si][sj][pre1][pre2]
                                v1, v2 = s1[pre1 + 1..ei], s2[pre2 + 1..ej]
                                if v1 == v2
                                    done = true
                                    break
                                end
                            end
                            pre2 += 1
                        end
                        pre1 += 1
                    end
                    if done
                        dp[si][sj][ei][ej] = true
                    end
                    j += 1
                end
                i += 1
            end

            cnt2 += 1
        end
        cnt1 += 1
    end


    return dp[0][0][l1 - 1][l2 - 1]
end

